Use a CSP-style network of coroutines/tasks to implement a streaming pipeline using [libcoro](https://github.com/jbaldwin/libcoro/). 

### TODO
- [x] Implement the foundation.
- [ ] Support channel broadcast (single output goes to multiple streaming nodes).
- [ ] Python bindings.
- [x] Pull libcoro from https://github.com/jbaldwin/libcoro/ and not my private fork.
- [x] Remove the CMake hacks.


### Code snippet
This is how the streaming pipeline in the shuffle benchmarks looks like:
```c++
    std::vector<streaming::Node> nodes;
    {
        auto ch1 = streaming::make_shared_channel<streaming::TableChunk>();
        nodes.push_back(
            streaming::node::random_table_generator(
                ctx,
                ch1,
                args.num_local_partitions,
                args.num_columns,
                args.num_local_rows,
                min_val,
                max_val
            )
        );
        auto ch2 = streaming::make_shared_channel<streaming::PartitionMapChunk>();
        nodes.push_back(
            streaming::node::partition_and_pack(
                ctx,
                ch1,
                ch2,
                {0},
                total_num_partitions,
                hash_function,
                seed
            )
        );
        auto ch3 = streaming::make_shared_channel<streaming::PartitionVectorChunk>();
        nodes.push_back(
            streaming::node::shuffler(ctx, ch2, ch3, op_id, total_num_partitions)
        );
        auto ch4 = streaming::make_shared_channel<streaming::TableChunk>();
        nodes.push_back(streaming::node::unpack_and_concat(ctx, ch3, ch4));
        nodes.push_back(consumer(ctx, ch4));
    }
    rapidsmpf::streaming::run_streaming_pipeline(std::move(nodes));
```

Where `consumer` is a task (coroutine) that reads chunks from the input channel (`ch4`) and discard them:
```c++
streaming::Node consumer(
    streaming::Context& ctx, streaming::SharedChannel<streaming::TableChunk> ch_in
) {
    streaming::ShutdownAtExit c{ch_in};
    co_await ctx.executor()->schedule();
    while (true) {
        std::shared_ptr<streaming::TableChunk> table =
            co_await ch_in->receive_or(nullptr);
        if (table == nullptr) {
            break;
        }
    }
}
```

